    false,nt"url": null,nt"notes": "The purpose of this Conservation Assessment
    is to summarize current knowledge concerning the status, distribution, ecology and
    population biology of the common loon, as well as threats to upper Great Lakes loon
    populations. This document is intended to inform the development of a Conservation
    Strategy for continued loon viability in the region. Emphasis has been placed upon
    information and issues directly relevant to loon populations in Michigan, Minnesota
    and Wisconsin. In the upper Great Lakes region, the common loon (Gavia immer) is
    a designated Regional Forester Sensitive Species on the Ottawa, Hiawatha and Huron-Manistee
    National Forests in Michigan. Species occurrence is documented but not designated
    as Sensitive on the Chequamegon-Nicolet National Forest in northern Wisconsin and
    the Superior and Chippewa National Forests in northern Minnesota.",nt"owner_org":
